import React from "react";
import { Typography, Space, Row, Col, Button } from "antd";
import { useRouter } from "next/router";
const { Text } = Typography;

const Home = () => {
	const router = useRouter();

	const toTest = () => {
		router.push("/test");
	};

	return (
		<>
			<Row justify="center">
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "120px",
						fontSize: "20px",
					}}
				>
					나랑 어울리는 애완동물은?
				</Text>
			</Row>

			<Row justify="center">
				<img
					style={{
						display: "block",
						margin: "90px auto 30px auto",
						maxWidth: "200px",
						height: "auto",
						objectFit: "cover",
					}}
					src={require("../assets/dog.png")}
				/>
			</Row>

			<Row justify="center">
				<Col xs={18} sm={18} md={18} lg={18} xl={18}>
					<Button
						style={{
							display: "block",
							marginTop: "40px",
							width: "100%",
							height: "40px",
						}}
						onClick={toTest}
					>
						테스트 시작!
					</Button>
				</Col>
			</Row>

			<Row style={{ height: "400px" }}></Row>
		</>
	);
};

export default Home;
